import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import CssBaseline from '@mui/material/CssBaseline';

export default function SelectLabels() {
  const [pmExpertise, setPmExpertise] = React.useState('');
  const [analysisExpertise, setAnalysisExpertise] = React.useState('');

  const handleChangePMExpertise = (event) => {
    setPmExpertise(event.target.value);
  };

  const handleChangeAnalysisExpertise = (event) => {
    setAnalysisExpertise(event.target.value);
  };

  return (
    <div>
      <CssBaseline />
      <FormControl sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-helper-label">PM</InputLabel>
        <Select
          labelId="demo-simple-select-helper-label"
          id="demo-simple-select-helper"
          value={pmExpertise}
          label="PM expertise"
          onChange={handleChangePMExpertise}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Basic</MenuItem>
          <MenuItem value={20}>Average</MenuItem>
          <MenuItem value={30}>Good</MenuItem>
          <MenuItem value={40}>Advanced</MenuItem>
        </Select>
        <FormHelperText>Select PM expertise</FormHelperText>
      </FormControl>
      <FormControl sx={{ m: 1, minWidth: 120 }}>
      <InputLabel id="demo-simple-select-helper-label">Analysis</InputLabel>
        <Select
          labelId="demo-simple-select-helper-label"
          id="demo-simple-select-helper"
          value={analysisExpertise}
          label="Analysis expertise"
          onChange={handleChangeAnalysisExpertise}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Basic</MenuItem>
          <MenuItem value={20}>Average</MenuItem>
          <MenuItem value={30}>Good</MenuItem>
          <MenuItem value={40}>Advanced</MenuItem>
        </Select>
        <FormHelperText>Select analysis expertise</FormHelperText>
      </FormControl>
      <p>You selected: {analysisExpertise}</p>
    </div>
  );
}
